import React,{Component} from 'react';

class Post extends Component{
  componentDidMount =() =>{
    fetch('https://jsonplaceholder.typicode.com/posts')
    .then(response => response.json())
    .then(data => console.log(data))
  }
  render(){
    return (
      <div>
        <h1>POSTS</h1>
      </div>
    )
  }
}

export default Post;
